import Vue from 'vue'
import VueRouter from 'vue-router'
import App from './App.vue'

import Home from '@/menus/DashboadPage'
import Dance from '@/views/DancePage'


// Vuex와 마찬가지로 플러그인 등록하기
Vue.use(VueRouter)
// VueRouter 인스턴스 생성하기
const router = new VueRouter({
  // URL 경로와 연결할 컴포넌트 맵핑하기
  routes: [
    {
      path: '/DashboadPage',
      component: Home
    },
    {
      path: '/DancePage',
      component: Dance
    }
  ]
})
//  생성한 VueRouter 인스턴스 익스포트하기
export default router



Vue(App).mount('#app')
